(function(window, angular) {
    'use strict';

    angular.module('App')
        .config([
            '$stateProvider',
            '$locationProvider',
            '$urlRouterProvider',
            function($stateProvider, $locationProvider, $urlRouterProvider) {

                $urlRouterProvider.when('/', '/wall');
                
                var states = [
                    {
                        name: 'emptyTemplate',
                        url: '/emptyTemplate',
                        component: 'emptyTemplate'
                    },
                    {
                        name: 'emptyTemplate2',
                        url: '/emptyTemplate2',
                        component: 'emptyTemplate2'
                    },
                    {
                        name: 'wall',
                        url: '/wall',
                        component: 'wall'
                    },
                    {
                        name: 'settings',
                        url: '/settings',
                        component: 'settings'
                    },
                    {
                        name: 'course',
                        url: '/course',
                        component: 'course'
                    },
                    {
                        name: 'kitchen',
                        url: '/kitchen',
                        component: 'kitchen'
                    },
                    {
                        name: 'vote',
                        url: '/vote',
                        component: 'vote'
                    },
                    {
                        name: 'myBody',
                        url: '/myBody',
                        component: 'myBody'
                    },
                    {
                        name: 'user',
                        url: '/user/{id:string}',
                        component: 'user',
                        resolve: {                            
                            userId: ['$stateParams', function($stateParams) {
                                return $stateParams.id;
                            }]
                        }
                    },
                    {
                        name: 'followers',
                        url: '/myWall/followers',
                        component: 'followers'
                    },
                    {
                        name: 'party',
                        url: '/party',
                        component: 'party'
                    },
                    {
                        name: 'messages',
                        url: '/messages',
                        component: 'messages'
                    },
                    {
                        name: 'taskPage',
                        url: '/taskPage',
                        component: 'taskPage'
                    },
                    {
                        name: 'usersPhotos',
                        url: '/usersPhotos/{id:string}',
                        component: 'usersPhotos',
                        resolve: {
                            activeAnchor: ['$stateParams', function($stateParams) {
                                return $stateParams.id;
                            }]
                        }
                    },
                    {
                        name: 'photoCommentsMobile',
                        url: '/photoCommentsMobile',
                        component: 'photoCommentsMobile'
                    }
                ];


                // Loop over the state definitions and register them
                states.forEach(function(state) {
                    $stateProvider.state(state);
                });

                // Default route
                $urlRouterProvider.otherwise("/");

                // Set hashbang prefix
                $locationProvider.hashPrefix('');

            }
        ]);
})(window, window.angular);
(function () {
  'use strict';

  angular.module('App')
    .run([
        '$rootScope', 
        '$window',
        '$timeout',
        'ngDialog',
        function ($rootScope, $window, $timeout, ngDialog) {
            // console.log('app run');
            $rootScope.showPreloader = true;
            $rootScope.popupOpeningStart = false;

            $rootScope.$on('popupOpeningStart', function() {
                // $rootScope.popupOpeningStart = true;
            });

            $rootScope.$on('$stateChangeStart', function(event, toState, toParams, fromState, fromParams){ 
                        // console.log('$stateChangeStart');               
                        ngDialog.closeAll();         
                        $rootScope.showPreloader = true;
            });

            $rootScope.$on('popupOpeningStart', function() {
                // $rootScope.popupOpeningStart = true;
            });

            $rootScope.onComponentInit = function() {
                // $rootScope.showPreloader = false;
                $timeout(() => {
                    $rootScope.showPreloader = false;
                }, 1);
            }

            $rootScope.$on('$stateChangeSuccess', function(event, toState, toParams, fromState, fromParams){ 
                        // console.log('$stateChangeSuccess');
            });
            
            $rootScope.$on('ngDialog.opened', function (e, $dialog) {
                $rootScope.popupOpeningStart = false;
                // console.log('ngDialog .opened: ' + $dialog.attr('id'));
            });

            function screenTypeTest() {
                if($window.innerWidth < 768)
                    return 'mobile'
                if($window.innerWidth >= 768 && $window.innerWidth <= 1199)
                    return 'tablet'
                if($window.innerWidth > 1199)
                    return 'desktop'
            }
            $rootScope.screenType = screenTypeTest();
            console.log($rootScope.screenType);
            // $scope.$watch(function() {
            //     return $rootScope.screenType;
            // }, function() {
            //     console.log('screen type - ', $rootScope.screenType);
            // }, true);
            angular.element($window).bind('resize', () => {
                console.log('screen type - ', $rootScope.screenType);
                $rootScope.screenType = screenTypeTest();
            });
        }
    ]);

})();